import React from "react";

const Signup = () => {
  return (
    <div className="p-3 md:p-4">
      <div className=" w-full bg-slate-600 mx-w-sm m-auto">
        <h1 className="text-center text-2xl font-bold">Sign Up</h1>
      </div>
    </div>
  );
};

export default Signup;
